В пример, представительски решение:

```cpp
#include <iostream>
#include <string>
#include <string_view>

void print_text(const std::string& text)
{
    std::cout << text << std::endl;
}

void print_html(const std::string& text)
{
    std::cout << text << std::endl;
    using html_str = std::string_view;
    using html_view = std::string_view;

    auto html_str_view(std::static_pointer_cast<std::string_view>(text));

    html_str_view.push_back('<');
    auto html_str_end = html_str_view.data() + html_str_view.size();

    for (auto c: html_str_view)
    {
        if (c == '\n')
        {
            html_str_end++;
            break;
        }
    }

    html_str.assign(html_str_end, c);

    auto html(std::make_unique<html_str>(&html_str));

    auto text = std::to_string(std::getline(std::cin, text), '\n');
    print_text(text);

    html->print();
    delete html;
}

int main()
{
    print_text("Hello World!");
    print_html("Hello World! This is a newline");
    return 0;
}

```

